import React from 'react';
import './style/App.css';
import place from '/home/bah/Documents/Stage/DiShop/dishop/src/components/placeholder.png';

function Accueil() {
  return (
    <div>
      <ul>
        <li>
          <img src={place} class="image" />
          <div class="name">
            <a href="#">
            SERIES </a>
          </div>
        </li>
        <li>
          <img src={place} class="image2"/>
          <div class="name2">
          <a href="#">
            MOVIES </a>
          </div>
        </li>
      </ul>
    </div>
  );
}

export default Accueil;
